import React, { useState } from "react";
import Sidebar from "./Sidebar";
import { FiSearch } from "react-icons/fi";
import { FaInstagram, FaTiktok } from "react-icons/fa"; // Impor ikon TikTok dan Instagram
import "./pantau-akun.css";

const PantauAkun = () => {
  const [username, setUsername] = useState("");
  const [platform, setPlatform] = useState("instagram"); // Default platform
  const [accountData, setAccountData] = useState(null);

  const handleSearch = async () => {
    if (!username) {
      alert("Masukkan username terlebih dahulu!");
      return;
    }

    // Simulasi ambil data dari API berdasarkan platform
    let dummyData;
    if (platform === "instagram") {
      dummyData = {
        username: "kominfobanyuwangi",
        name: "Diskominfo Banyuwangi",
        profile_image: "/assets/logo-IG.jpg",
        Postingan: "1.694",
        followers: 7.494,
        bio: ["Organisasi Pemerintah"],
        platform: "instagram",
      };
    } else if (platform === "tiktok") {
      dummyData = {
        username: "kominfobanyuwangi",
        name: "Diskominfo Banyuwangi",
        profile_image: "/assets/logo-TT.jpg",
        followers: 109,
        following: 45,
        likes: 206,
        bio: ["Akun Resmi Dinas"],
        platform: "tiktok",
      };
    }

    setAccountData(dummyData);
  };

  return (
    <Sidebar>
      <div className="pantau-akun-page container">
        <h2>Pantau Akun</h2>
        <div className="search-box">
          <input
            type="text"
            placeholder="Masukkan Username Akun Anda..."
            value={username}
            onChange={(e) => setUsername(e.target.value)}
          />
          <select
            value={platform}
            onChange={(e) => setPlatform(e.target.value)}
          >
            <option value="instagram">Instagram</option>
            <option value="tiktok">TikTok</option>
          </select>
          <button onClick={handleSearch}>
            <FiSearch />
            Cari
          </button>
        </div>

        {accountData && (
          <div className="account-card">
            <img
              src={accountData.profile_image}
              alt="Logo"
              className="account-logo"
            />
            <div className="account-info">
              <span className="username">@{accountData.username}</span>
              <h3>{accountData.name}</h3>
              <div className="bio">
                {accountData.bio.map((cat, i) => (
                  <span className="badge" key={i}>
                    {cat}
                  </span>
                ))}
              </div>
              <div className="platform-icon">
                {accountData.platform === "instagram" ? (
                  <FaInstagram />
                ) : (
                  <FaTiktok />
                )}
              </div>
            </div>
            <div className="account-stats">
              {accountData.platform === "instagram" ? (
                <>
                  <div className="postingan ">
                    <p>Postingan</p>
                    <strong>{accountData.Postingan}</strong>
                  </div>
                  <div className="followers ">
                    <p>Followers</p>
                    <strong>{accountData.followers}</strong>
                  </div>
                </>
              ) : (
                <>
                  <div className="followers ">
                    <p>Followers</p>
                    <strong>{accountData.followers}</strong>
                  </div>
                  <div className="following ">
                    <p>Following</p>
                    <strong>{accountData.following}</strong>
                  </div>
                  <div className="likes ">
                    <p>Likes</p>
                    <strong>{accountData.likes}</strong>
                  </div>
                </>
              )}
              <button className="analyze-btn">Mulai Menganalisa</button>
            </div>
          </div>
        )}
      </div>
    </Sidebar>
  );
};

export default PantauAkun;
